import React from "react";
import { useSelector } from "react-redux";

export default function Status() {
    const full_data = useSelector(state => state);
    let data_arr = full_data.then(res=>console.log('res', res))
    return (
        <div className="column">
            <p>{data_arr}</p>
        </div>
    );
}
